import React from 'react';
import Jumbotron from './components/Jumbotron';
import ImageThumbnail from './components/Image-thumbnail';

const imgCast =["../images/arya.jpeg"]


function App() {
  return (
<div>
  <Jumbotron />
  <div className="container">
    <div className="row">
      <div className="col">
        <ImageThumbnail 
        imgSource={imgCast[0]}/>
      </div>
    </div>
  </div>
</div>
  );
}

export default App;
